### Describe the issue

1. I have exported some onnx models use torch.onnx.export()  in my Python codes
2. Then i try to use one of my onnx models to run LSTM, and i got a output data(a std::vector<Ort::Value>)
3. I converted my std::vector<Ort::Value> to at::tensor
4. I found that the output of the onnx lstm model is very different from the output of my original libtorch lstm
But I don't know where I am going wrong, is the model export wrong or the input parameters wrong? Or am I converting std::vector<Ort::Value> to at::tensor wrong? Can someone provide some troubleshooting tips idea?

### To reproduce

```cpp
at::Tensor OnnxValueVecToTorchTensor(std::vector<Ort::Value> &onnx_value_vector)
{
    const auto &output_tensor = onnx_value_vector.front();
    auto type_info = output_tensor.GetTensorTypeAndShapeInfo();
    auto elem_type = type_info.GetElementType();
    auto elem_count = type_info.GetElementCount();
    auto shape_info = type_info.GetShape();
    std::cout << "this onnx tensor's elem_count:" << elem_count << std::endl;
    std::cout << "this onnx tensor's shape info:[";
    for(auto a:shape_info)
    {
        std::cout << a << ",";
    }
    std::cout << "]" << std::endl;
    
    DataType_t datatype = static_cast<DataType_t>(elem_type);

    std::vector<float> onnx_out;
    for(int i = 0; i < elem_count; i++)
    {
        onnx_out.emplace_back(*(output_tensor.GetTensorData<float>()+i));
    }
    
    c10::IntArrayRef shape = c10::ArrayRef<int64_t>(shape_info.data(), shape_info.size());
    return torch::tensor(onnx_out).view(shape); 
}
```

